def count_occurrences(string, char):
    count = 1
    stack = []
    for c in string:
        if c == '(' or c == '{':
            stack.append(c)
        elif c == ')' or c == '}':
            if stack:
                stack.pop()
        elif not stack and c == char:
            count += 1
    return count

